Node.js When updating a document failed, is best to throw an exception or returning information?<p>I have an <code>updateDocument</code> method in a class for a service layer in a node.js, express, mongoose application. I'm wondering what is the best practice for handing cases where the update method didn't update a document, for example if the wrong id is passed in.</p>
<p><strong>Version 1: If the update wasn't successful, return an object with <code>success: false</code>:</strong></p>
<pre class="lang-js prettyprint-override"><code>  async updateDocument(id, updates) {
    const output = await this.DocumentModel.updateOne({ _id: id }, updates);

    let message = 'Something went wrong';
    let success = false;
    let updatedItem = null;
    if (output.nModified) {
      message = 'Successfully updated document.';
      success = true;
      updatedItem = await this.getDocument(id);
    }

    return { message, success, updatedItem};
  }
</code></pre>
<p><strong>Version 2: If the update wasn't successful, throw an error:</strong></p>
<pre class="lang-js prettyprint-override"><code>  async updateDocument(id, updates) {
    const output = await this.DocumentModel.updateOne({ _id: id }, updates);

    let updatedItem;

    if (output.nModified) {
      updatedItem = await this.getDocument(id);
    } else{
      throw new Error(&quot;The document wasn't updated&quot;)
    }

    return updatedItem;
  }
</code></pre>
<p>Do you always throw an exception when the input, such as a bad id, isn't correct? Or could you return information about the update being a success or not? As newbie node.js developer, I'm not sure I am grasping the full picture enough to recognize problems with either method.</p>

