How to save and send JWT token from frontend<p>I am using JWT in my node.js app. Everything with token works fine. I can get a token when I have logged in.</p>
<p>Here's how I check user auth.:</p>
<pre><code>const jwt = require('jsonwebtoken')

try{
    const token = req.headers.authorization
    const decoded = jwt.verify(token, 'secret')
    req.userData = decoded
    next()
}
catch(err){
    return res.send(&quot;Auth error&quot;)
}
</code></pre>
<p>I can access protected routes if I change <code>token</code> value with that token I've got after log in.</p>
<p>But I want to save the token (on user's side???), and each time when the user tries to access protected routes (from frontend), send token as <code>req.headers.authorization</code>, so that the token can be verified, and the user can access the route.</p>
<p>So, how to save and later send the token, that has been generated after user's log in each time when protected routes are linked to?</p>
<p>Thank you.</p>
<p>(I am not using any javascript frontend frameworks)</p>

