MongoDB How to perform an aggregation lookup on array of an array<p>is it possible to aggregate and join match data like so:</p>
<p><code>application (Document) -&gt; roles (DBRef array) -&gt; permissions (DBRef array) -&gt; name (String)</code></p>
<p>The application has roles, roles have permissions and permissions have a name.</p>
<p>I have been trying to figure out how I can make an aggregation operation that would achieve this type of complex join. What I want to do is choose the <strong>application</strong> that has the <strong>role</strong>, that has the <strong>permission</strong> of a given name.</p>
<p>Here is the basic example documents I have:</p>
<p><strong>application:</strong></p>
<pre><code>{
    &quot;_id&quot;: {
        &quot;$numberLong&quot;: &quot;11&quot;
    },
    &quot;name&quot;: &quot;my-module&quot;,
    &quot;roles&quot;: [{
        &quot;$ref&quot;: &quot;role&quot;,
        &quot;$id&quot;: {
            &quot;$numberLong&quot;: &quot;17&quot;
        }
    }
}
</code></pre>
